  \"mont95c-bathymetry-contours-of-the-southern-monterey-bay-area-between-moss-landing-and-montere\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The bathymetric grids and derived contours
  are from data collected by the USGS with a multibeam (Simrad EM1000) sidescan sonar
  system in the southern Monterey Bay between Moss Landing and Monterey, California
  in 1995 (P1-95-MB, http://walrus.wr.usgs.gov/infobank). The data are provided as
  ArcInfo grids with 5-m resolution (MONT95NG, MONT95SG) and contours at 10-m intervals,
  and as shaded relief images (MNT95NSD.TIF, MNT95SSD.TIF) in the data/shaderel directory
  of this publication. This is one of a collection of digital files of a geographic
  information system of spatially referenced data related to the USGS Coastal and
  Marine Geology Program \"Monterey Bay National Marine Sanctuary Project\" http://walrus.wr.usgs.gov/mbms>.
  The data were collected and analyzed between 1994 and 2000.\",\n\t\"license_title\":
